import React, {useEffect} from 'react';
import './Dm.css';

/**
* @param {Object} props - Channel Name
* @return {JSX} - Channel Page
*/
function Dm(props) {
  console.log(props.workspace, 'workspace');
  console.log(props.name, 'name');
  console.log(props.main, 'main');
  console.log(props.side, 'side');
  // const [currMessages, setCurrMessages] = React.useState([]);
  useEffect(() => {
    const second = `&workspace=${props.workspace}&userSecond=${props.side}`;
    fetch(`http://localhost:3010/v0/dms?user=${props.main}` + second)
      .then(async (res) => {
        const messageArray = [];
        if (res.status === 200) {
          const foundMessages = await res.json();
          for (const message in foundMessages) {
            if (message) {
              messageArray.push(createMessage(message));
              console.log(message);
            }
          }

        }
      },
      )
      .catch((err) => err);
  }, [props.workspace]);
  /**
  * @param {JSON} object - Message Object with Information
  * @return {JSX} - JSX for Message
  */
  function createMessage(object) {
    return (
      <div id='message'>{object}</div>
    );
  }
  return (
    <div>
      <div id='dm-head'>
        <div id='dm-type'>
          {props.name}
        </div>
      </div>
      <div id='dm-main'>
      </div>
    </div>
  );
}

export default Dm;
